"use strict";

const accumulate = (arr) => arr.reduce((a, v) => [...a, a[a.length - 1] + v], [0]);

function maxSumMinProduct(nums) {
    const mod = 1e9 + 7;
    const n = nums.length;
    const left = Array(n).fill(-1);
    const right = Array(n).fill(n);
    const stk = [];
    for (let i = 0; i < n; i++) {
        const v = nums[i];
        while (stk.length && nums[stk[stk.length - 1]] >= v) {
            stk.pop();
        }
        if (stk.length) {
            left[i] = stk[stk.length - 1];
        }
        stk.push(i);
    }
    stk.length = 0;
    for (let i = n - 1; i >= 0; i--) {
        const v = nums[i];
        while (stk.length && nums[stk[stk.length - 1]] > v) {
            stk.pop();
        }
        if (stk.length) {
            right[i] = stk[stk.length - 1];
        }
        stk.push(i);
    }
    const s = accumulate(nums);
    const ans = Math.max(...nums.map((v, i) => v * (s[right[i]] - s[left[i] + 1])));
    return ans % mod;
}
